			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# Type a script or drag a script file from your workspace to insert its path.\n#!/bin/bash\narray=()\nlineNo=0\n#读取headers.strings每一行，存到数组\nwhile read LINE\ndo\narray[lineNo]=$LINE\n((lineNo++))\ndone < $PROJECT_DIR'/'$TARGET_NAME'/Headers.strings'\n\nread_dir(){\n    for file in `ls -a $1`\n    do\n        if [ -d $1\"/\"$file ]\n        then\n            if [[ $file != '.' && $file != '..' ]]\n            then\n                read_dir $1\"/\"$file $2\n            fi\n        else\n            #在headers.strings里 就拷贝\n            if [[ \"${array[@]}\" =~ \"$file\" ]];then\n                cp -rvf $1\"/\"$file $2\"/\"$file\n                #遍历文件包含以下字符串的去掉尖括号，使用双引号\n                allArray=(\"#include <react/\" \"#import <React/\" \"#include <cxxreact/\" \"#include <ReactCommon/\" \"#import <ReactCommon/\" \"#import <yoga/\" \"#include <jsireact/\" \"#include <jsi/\" \"#import <react/\" \"#include <butter/\" \"#include <yoga/\")\n                for(( i=0;i<${#allArray[@]};i++)) do\n                    oldString=${allArray[i]};\n                    #搜索文件中包含关键字，遍历替换\n                    grep -E \"$oldString\" $2\"/\"$file  | while read line\n                    do\n                        new=`echo $line | awk -F'[/>]' '{print $(NF-1)}'`\n                        echo $new  #截取出文件名，通过斜杠和右尖括号\n                        imOrIn=`echo $oldString | awk -F' ' '{print $1}'`\n                        echo $imOrIn  #截取出import 或者include\n                        sed -i '' \"s%$line%$imOrIn \\\"$new\\\"%g\" $2\"/\"$file\n                    done\n                done;\n            fi\n        fi\n    done\n}\n\n#自动拷贝\nread_dir $PROJECT_DIR/../node_modules $BUILT_PRODUCTS_DIR'/'$TARGET_NAME'.framework/Headers'\n";
